var script_f14_34_14881=[" ",
"",
"var calctxt = '';",
"var xmltxt = '';",
"var htmtxt = '';",
"",
"",
"function MASCC_fx() {",
"with(document.MASCC_form){",
"",
"Score = 0.0;",
"doCalc = true;",
"",
"if (cc1[0].checked){",
"Score = Score + 5;",
"}",
"if (cc1[1].checked){",
"Score = Score + 3;",
"}",
"if (cc1[2].checked){",
"Score = Score + 0;",
"}",
"if (cc2.checked){",
"Score = Score + 5;",
"}",
"if (cc3.checked){",
"Score = Score + 4;",
"}",
"if (cc4.checked){",
"Score = Score + 4;",
"}",
"if (cc5.checked){",
"Score = Score + 3;",
"}",
"if (cc6.checked){",
"Score = Score + 3;",
"}",
"if (cc7[0].checked){",
"Score = Score + 2;",
"}",
"if (cc7[1].checked){",
"Score = Score + 0;",
"}",
"cctotal.value = Score;",
"",
"if (doCalc){",
"rrclr();",
"if ((Score >= 21) && (Score <= 26)){ document.getElementById('rr1_1').bgColor = '#cccccc';",
"}",
"if ((Score >= 0) && (Score <= 20)){ document.getElementById('rr1_2').bgColor = '#cccccc';",
"}",
"",
"}",
"}",
"}",
"",
"",
"",
"",
"function rrclr(){",
"document.getElementById('rr1_1').bgColor = \"\";",
"document.getElementById('rr1_2').bgColor = \"\";",
"}",
"",
"",
""].join("\n");
