"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Anderson EJ, Guzman-Cottrill JA, Kletzel M, et al, \"High-Risk Adenovirus-Infected Pediatric Allogeneic Hematopoietic Progenitor Cell Transplant Recipients and Preemptive Cidofovir Therapy,\"",
"      <i>",
"       Pediatr Transplant",
"      </i>",
"      , 2008, 12(2):219-27.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?14/34/14886/abstract-text/18307672/pubmed\" id=\"18307672\" target=\"_blank\">",
"        18307672",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Araya CE, Lew JF, Fennell RS, et al, \"Intermediate Dose Cidofovir Does Not Cause Additive Nephrotoxicity in BK Virus Allograft Nephropathy,\"",
"      <i>",
"       Pediatr Transplant",
"      </i>",
"      , 2008, 12(7):790-5.",
