var title_f14_34_14892="Tests for lung maturity";
var content_f14_34_14892=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F64274&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F64274&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Tests for determining fetal lung maturity",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Test",
"       </td>",
"       <td class=\"subtitle1\">",
"        Positive discriminating value",
"       </td>",
"       <td class=\"subtitle1\">",
"        Predictive value for pulmonary maturity when test is mature*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Predictive value for pulmonary immaturity when test is immature*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pro's and con's",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lecithin sphingomyelin ratio",
"       </td>",
"       <td>",
"        Greater than or equal to 2.0",
"       </td>",
"       <td>",
"        95-100 percent",
"       </td>",
"       <td>",
"        33-50 percent",
"       </td>",
"       <td>",
"        Time-consuming, complex test with large laboratory variation. Results affected by blood and meconium. Avoid use of a vaginal pooled sample.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Phosphatidylglycerol",
"       </td>",
"       <td>",
"        Present (typically greater than 3 percent of total phospholipids when performed by thin-layer chromatography, at least 0.5 when performed by slide agglutination)",
"       </td>",
"       <td>",
"        95-100 percent",
"       </td>",
"       <td>",
"        23-53 percent",
"       </td>",
"       <td>",
"        Time-consuming, complex test if performed using thin-layer chromatography, but a rapid and simple immunological method (slide agglutination) that uses antisera to phosphatidylglycerol is available. Not affected by blood, meconium. Bacteria can give a false positive in vaginal pool samples.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        FLM-TDx ll",
"       </td>",
"       <td>",
"        &gt;55 mg/g of albumin",
"       </td>",
"       <td>",
"        96-100 percent",
"       </td>",
"       <td>",
"        47-61 percent",
"       </td>",
"       <td>",
"        Results affected by blood and meconium. Can use a vaginal pooled sample. Minimal inter/ intraassay variability. Simple test.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lamellar body count",
"       </td>",
"       <td>",
"        30,000-40,000&bull;",
"       </td>",
"       <td>",
"        97-98 percent",
"       </td>",
"       <td>",
"        29-35 percent",
"       </td>",
"       <td>",
"        Results affected by blood but not by meconium. Cannot use a vaginal pooled sample.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The predictive value for each test is influenced by the prevalence of RDS in the population, thus it varies with gestational age.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      &ge;50,000 is the current threshold for maturity (see text).",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: ACOG Practice Bulletin No. 97: Fetal Lung Maturity. Obstet Gynecol 2008; 112:717.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
