var title_f14_34_14893="BTS diving guidelines b";
var content_f14_34_14893=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F54026&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F54026&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Summary of key points and recommendations (continued)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Recommendations on specific respiratory conditions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lung bullae or cysts increase risk of barotrauma and are contraindications to diving.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Previous",
"spontaneous pneumothorax is a contraindication unless treated by",
"bilateral surgical pleurectomy and associated with normal lung function",
"and thoracic CT scan performed after surgery.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Subjects with asthma should be advised not to dive if they have wheeze precipitated by exercise, cold, or emotion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"1\">",
"        Subjects with asthma may be permitted to dive if, with or without",
"regular inhaled anti-inflammatory agents (step 2 of the BTS",
"guidelines), they:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Are free of asthma symptoms;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Have normal spirometry (FEV1&gt;80 percent predicted and FEV1/VC ratio &gt;70 percent predicted); and",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Have a negative exercise test (&lt;15 percent fall in FEV1 after exercise).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Subjects with",
"asthma should monitor their asthma with regular twice daily peak flow",
"measurement and should refrain from diving if they have:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Active asthma - that is, symptoms requiring relief medication in the 48 hours preceding the dive;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        An increased peak flow variability (more than 20 percent diurnal variation).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        COPD",
"carries a theoretical increased risk of barotrauma and reduced exercise",
"tolerance. Subjects will probably be advised against diving on the",
"basis of reduced pulmonary function (FEV1 &lt;80 percent predicted).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Sarcoidosis has been associated with pulmonary barotrauma. Diving is",
"contraindicated in subjects who have active sarcoidosis. Those in whom",
"sarcoidosis has resolved should have normal chest radiography and",
"pulmonary function testing before being advised that they may proceed",
"with diving.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tuberculosis is a",
"potentially transmissible disease that may cause residual impairment of",
"lung structure and function. A subject with active tuberculosis should",
"not dive. After curative treatment they may dive if lung function and",
"chest radiograph are normal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Cystic",
"fibrosis is often associated with abnormal pulmonary function and",
"increased risk of pneumothorax. Diving is contraindicated in those",
"patients who have pulmonary involvement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fibrotic lung",
"disease reduces lung compliance and impairs gas transfer. Diving is",
"therefore contraindicated in subjects who have fibrotic lung disease.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Long term effects of diving on the lung",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Divers",
"tend to have large lung volumes with proportionately greater increases",
"in vital capacity than in FEV1. This may be attributable in part to the",
"effects of repeatedly breathing dense gas through increased resistances.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Divers may have reduced expiratory flow rates at low lung volumes, possibly reflecting small airway disease.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vital capacity of divers may decline with age at an increased rate.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Saturation diving causes a fall in carbon monoxide transfer which, once",
"the dive is completed, gradually returns to pre-dive values.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Sources of specialist advice",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        In the United Kingdom, advice on sports diving",
"may be sought from the medical referees of the British Sub Aqua Club,",
"the Scottish Sub Aqua Club, or the Sub Aqua Association. Information is",
"available on the UK Sport Diving Medical Diving Committee website",
"(file://ww.uksdmc.co.uk). The Royal Navy Institute of Naval Medicine is",
"also willing to discuss cases with both divers and physicians.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        The Health and Safety Executive (HSE) is",
"responsible for commercial diving policy and regulation. Individuals",
"who are diving at work require a current HSE certificate of fitness to",
"dive following examination by an approved medical examiner of divers.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from Thorax, British Thoracic Society guidelines on respiratory aspects of fitness for diving, volume 58, pages 3-13, Copyright &copy; 2003, with permission from&nbsp;BMJ Publishing Group Ltd.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
