var title_f14_34_14895="Gram stain of Campylobacter jejuni in stool";
var content_f14_34_14895=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F78674&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F78674&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Gram stain of Campylobacter jejuni in stool",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 368px; height: 240px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Gram stain of stool (x1000) can, in some cases, show Campylobacter jejuni, which are small, faint Gram negative curved rods which may be gull-winged in shape. This finding may provide presumptive evidence of Campylobacter infection prior to the results of stool culture. Optimal atmospheric condition is 85 percent nitrogen, 10 percent carbon dioxide, and 5 percent oxygen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Harriet Provine.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
